import React from 'react';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import ResponsiveAppBar from './appBar/navbar'
import SignIn_form from './signIn_form/signIn'

const Home = () => {
    return (
        <Box sx={{ flexGrow: 1 }}>
            <Grid container spacing={1}>
                <Grid xs={12} md={12}>
                    <ResponsiveAppBar />
                </Grid>
                <Grid xs={6} md={6}>
                <SignIn_form />
                </Grid>
                <Grid xs={6} md={6}>
                    <Item>xs=6 md=8</Item>
                </Grid>
            </Grid>
        </Box>

    );
}

export default Home;
